// src/components/Navbar/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="bg-white shadow dark:bg-gray-800 p-4 flex justify-between">
      <h1 className="text-xl font-bold text-pink-600">LinkClick</h1>
      <nav className="flex gap-4">
        <Link to="/tutorials" className="text-gray-700 hover:text-pink-600">Tutorials</Link>
        <Link to="/reminders" className="text-gray-700 hover:text-pink-600">Reminders</Link>
        <Link to="/services" className="text-gray-700 hover:text-pink-600">Services</Link>
        <Link to="#" className="text-gray-700 hover:text-pink-600">About Us / FAQ</Link>
        <Link to="/" className="text-gray-700 hover:text-pink-600">Login</Link>
        <Link to="/signup" className="text-pink-600 font-bold hover:underline">Signup</Link>
      </nav>
    </header>
  );
};

export default Navbar;
